eval("/* provided dependency */ var __react_refresh_utils__ = __webpack_require__(/*! ./node_modules/@pmmmwh/react-refresh-webpack-plugin/lib/runtime/RefreshUtils.js */ \"./node_modules/@pmmmwh/react-refresh-webpack-plugin/lib/runtime/RefreshUtils.js\");\n__webpack_require__.$Refresh$.runtime = __webpack_require__(/*! ./node_modules/react-refresh/runtime.js */ \"./node_modules/react-refresh/runtime.js\");\n\n\"use strict\";\nvar __importDefault = (this && this.__importDefault) || function (mod) {\n    return (mod && mod.__esModule) ? mod : { \"default\": mod };\n};\nObject.defineProperty(exports, \"__esModule\", ({ value: true }));\nvar react_1 = __importDefault(__webpack_require__(/*! react */ \"./node_modules/react/index.js\"));\nvar _components_1 = __webpack_require__(/*! @components */ \"./src/components/index.ts\");\nvar styles_module_scss_1 = __importDefault(__webpack_require__(/*! ../styles.module.scss */ \"./src/pages/Blog/posts/styles.module.scss\"));\nvar SDC = function () { return (react_1.default.createElement(\"div\", { className: styles_module_scss_1.default.root },\n    react_1.default.createElement(_components_1.SeoData, { title: \"A First Dive Into System Design | Bertrand Shao\", description: \"Learn about my experience doing Hack Reactor's system design capstone (SDC).\", keywords: \"system design capstone, SDC, Hack Reactor, bootcamp, ten million records, mongodb, postgresql\" }),\n    react_1.default.createElement(_components_1.ScrollIndicator, null),\n    react_1.default.createElement(\"div\", { className: styles_module_scss_1.default.center },\n        react_1.default.createElement(\"h1\", null, \"A First Dive Into System Design\"),\n        react_1.default.createElement(\"h2\", { className: styles_module_scss_1.default.subheader }, \"How to Operationalize and Scale a Web App\")),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.mainImage, src: \"/servers.jpg\", alt: \"graphic depicting computer servers on the cloud\" }),\n    react_1.default.createElement(\"div\", { className: styles_module_scss_1.default.descriptionContainer },\n        react_1.default.createElement(\"div\", { className: styles_module_scss_1.default.descriptions },\n            react_1.default.createElement(\"div\", null,\n                react_1.default.createElement(\"span\", { className: styles_module_scss_1.default.descriptor1 }, \"Timeline\"),\n                react_1.default.createElement(\"span\", { className: styles_module_scss_1.default.descriptor2 }, \"3 Month (April 2020 - June 2020)\")),\n            react_1.default.createElement(\"div\", null,\n                react_1.default.createElement(\"span\", { className: styles_module_scss_1.default.descriptor1 }, \"Role\"),\n                react_1.default.createElement(\"span\", { className: styles_module_scss_1.default.descriptor2 }, \"Hack Reactor Student\"))),\n        react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.subtext },\n            react_1.default.createElement(\"i\", null, \"What does it take to generate and insert ten million data points into a database efficiently? What strategies can we implement to handle thousands of user requests per second on our service?\"))),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"These were the burning questions my team and I faced in the final phase of our 13-week bootcamp. Up until then, our primary focus has been on the front-end. Question about a bug? Drop a \\u201Cconsole.log\\u201D. State not rendering? Consult the dev tool GUI. Checking underneath the hood and optimizing server capabilities? Now that\\u2019s a different story. Our focus had shifted towards areas with less visibility and we had to adjust our strategies accordingly. But fret not! After all, decrypting the magic of the servers and databases is essential to becoming a well rounded developer. With that in mind, we dove headfirst into the mysteriously exciting world of system design.\"),\n    react_1.default.createElement(\"h3\", { className: styles_module_scss_1.default.sectionHeader }, \"Creating the 10,000,000\"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text },\n        \"For background, our team was given a functional legacy codebase to perform queries off of. The problem was that this existing database only housed 100 records. Each of us had to develop our own techniques to increase that figure to 10,000,000. Scary number isn\\u2019t it? As it turns out, ten million records is not much to brag about when it comes to large scale production sites (think\",\n        \" \",\n        react_1.default.createElement(\"a\", { href: \"facebook.com\", target: \"_blank\" }, \"facebook.com\"),\n        \").\"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text },\n        \"To hit this mark, I first needed a function that would generate unique sets of items. Since the existing codebase UI copied a Nike product page, this meant generating shoe artifacts with fresh new information every time. With help from several helper functions, I created a random shoe generator that encapsulated data points such as shoe name, price, size- the kind of details that come to mind when you think about a Nike shoe.\",\n        \" \"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"With a generator function up and running, I ran into a new challenge. Turns out writing data into a JSON file temporarily took up a sizable chunk of RAM space. How was I supposed to run this function ten million times without overloading my machine? After some digging, I found the answer in \\u201Cfs.createWriteStream\\u201D and its \\u201Cdrain\\u201D method.\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/drain.jpg\", alt: \"code for drain and stream\" }),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text },\n        \"According to\",\n        \" \",\n        react_1.default.createElement(\"a\", { href: \"https://areknawo.com/node-js-file-streams-explained/\", target: \"_blank\", rel: \"noreferrer\" }, \"documentation\"),\n        \", everytime we call the write() method we write data to an internal buffer. Once this buffer reaches its capacity (or exceeds its highWaterMark property), the drain event fires to prevent more data from being written while simultaneously \\u201Cflushing\\u201D the previously occupied memory. Doing so prevents high memory bottlenecks and crashes.\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/finished.jpg\", alt: \"finished in 256.51 seconds\" }),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"And just like that, I had successfully occupied my JSON file with 10 million unique nike shoe objects in a little under 5 minutes.*\"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.highlight }, \"*Make sure to add this aggressively large JSON file to your gitignore before pushing your repo!\"),\n    react_1.default.createElement(\"h3\", { className: styles_module_scss_1.default.sectionHeader }, \"Choosing a Database\"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"Next, my job was to copy these 10 million records over into a database of choice. The legacy server had used MongoDB, but switching over to a relational (SQL) database such as PostgreSQL was also an option. To identify which better suited our needs, I had to weigh some pros and cons and benchmark the two.\"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text },\n        \"Traditionally speaking, MongoDB and other document databases excel at working with formats such as JSON data. However, recently PostgreSQL has also begun offering enhanced JSON storage capabilities. Some\",\n        \" \",\n        react_1.default.createElement(\"a\", { href: \"https://www.sisense.com/blog/postgres-vs-mongodb-for-storing-json-data/\", target: \"_blank\", rel: \"noreferrer\" }, \"online sources\"),\n        \" \",\n        \"will say that PostgreSQL offers transactional integrity and data optimization features at the cost of speed and performance. But at the same time, a\",\n        \" \",\n        react_1.default.createElement(\"a\", { href: \"https://www.enterprisedb.com/blog/comparison-mongodb-vs-postgresql\", target: \"_blank\", rel: \"noreferrer\" }, \"test in 2014\"),\n        \" \",\n        \"showed PostgreSQL beating out MongoDB in categories such as data ingestion, selection, and inserts by large margins. On the other hand, MongoDB proved superior in updating individual fields whereas PostgreSQL required one to extract the whole document and rewrite it back after changes were made.\"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text },\n        \"Considering that my service only required searching an individual product given an ID, I decided PostgreSQL would be my best bet. Its JSONB representation automatically assigned an auto incrementing ID to each item. This in conjunction with PostgreSQL\\u2019s\",\n        \" \",\n        react_1.default.createElement(\"a\", { href: \"https://www.postgresql.org/docs/10/indexes-index-only-scans.html\", target: \"_blank\", rel: \"noreferrer\" }, \"index-only scan\"),\n        \" \",\n        \"meant that queries would only check over the auto incrementing ID and save time by ignoring the rest of the table\\u2019s data (also known as the \\u201Cheap\\u201D).\"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"Just to be sure, I seeded both databases and benchmarked individual query time against each other. With a bit of performance tuning and optimization, I was able to achieve the following results:\"),\n    react_1.default.createElement(\"h4\", { className: styles_module_scss_1.default.sectionHeader }, \"MongoDB:\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/mongospeed.jpg\", alt: \"query speed on mongodb\" }),\n    react_1.default.createElement(\"h4\", { className: styles_module_scss_1.default.sectionHeader }, \"PostgreSQL:\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/postgresspeed.jpg\", alt: \"query speed on postgresql\" }),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"Sure enough, PostgreSQL saw an all around faster querying speed.\"),\n    react_1.default.createElement(\"h3\", { className: styles_module_scss_1.default.sectionHeader }, \"Stress Testing on Local Machine\"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text },\n        \"Now it was time to simulate virtual users making multiple queries on our local machine. I opted to use\",\n        \" \",\n        react_1.default.createElement(\"a\", { href: \"https://k6.io/open-source/\", target: \"_blank\", rel: \"noreferrer\" }, \"k6\"),\n        \" \",\n        \"as it mimicked traffic spikes by rapidly increasing and decreasing the load in stages.\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/k6.jpg\", alt: \"k6 setup\" }),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"What this test is saying is that over the duration of \\u2018X\\u2019 seconds, slowly ramp up to \\u2018X\\u2019 amount of virtual users making requests. At our breaking point, we aimed to ramp up to 300 requests over 20 seconds. While certainly not a lot to handle, it was interesting to see how it would affect the speed of my laptop\\u2019s response time (otherwise known as latency).\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/k6metrics.jpg\", alt: \"k6 metrics\" }),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text },\n        \"While the above data may seem confusing at first, pay close attention to the line \\\"http_req_waiting\\\". This represents the time waiting for a response from the remote host.\",\n        \" \",\n        react_1.default.createElement(\"a\", { href: \"https://newrelic.com/\", target: \"_blank\", rel: \"noreferrer\" }, \"New Relic\"),\n        \" \",\n        \"does a clearer job of depicting the latency.\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/newrelic.jpg\", alt: \"newrelic metrics\" }),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"On average, a request takes 365 ms to process. According to k6, at the peak of 300 virtual users, a request could take as long as two whole seconds! Compared to individual query times of around 1-2 ms, this was certainly a loss in performance. To do better, we needed to scale.\"),\n    react_1.default.createElement(\"h3\", { className: styles_module_scss_1.default.sectionHeader }, \"Deploying on an EC2 Instance\"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"Two commonly known techniques to handle more traffic are vertical scaling and horizontal scaling. To put it as simply as possible, vertical scaling works by adding more power (CPU, RAM) to an existing machine. Imagine a computer that grows to handle more stress by getting taller and taller (i.e. growing vertically). On the other hand, horizontal scaling means the computer size stays the same but we lessen the individual load by adding more same-sized computers to the mix. Imagine a net made up of computers that grows horizontally to distribute the traffic load evenly. For learning purposes, we decided to see what strategies we could employ by horizontally scaling using AWS T2 micro instances.\"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text },\n        \"Starting off with a single instance, I simulated 500 responses per second (RPS) over 1 minute using\",\n        \" \",\n        react_1.default.createElement(\"a\", { href: \"https://loader.io/\", target: \"_blank\", rel: \"noreferrer\" }, \"Loader.io\"),\n        \".\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/80ms.jpg\", alt: \"80ms at 500rps\" }),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"80 ms response time on average at a 0% error rate. Not bad; certainly better than our local machine. Now how about 1000 RPS?\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/497ms.jpg\", alt: \"497ms at 1000rps\" }),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"The RPS climbed dramatically and the error rate shot up to 34.8%. Certainly not the user experience we would want to see on a production level site. Let\\u2019s see how we improved those numbers.\"),\n    react_1.default.createElement(\"h3\", { className: styles_module_scss_1.default.sectionHeader }, \"Load Balancing and Horizontal Scaling\"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text },\n        \"We briefly discussed the concept of horizontal scaling earlier, but how is it done? Turns out there were many ways of distributing the traffic over multiple server instances (also known as load balancing). After some research, I settled on using a popular, open-source software known as\",\n        \" \",\n        react_1.default.createElement(\"a\", { href: \"https://www.nginx.com/\", target: \"_blank\", rel: \"noreferrer\" }, \"NGINX\"),\n        \".\"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text },\n        \"While there was a brief learning curve, the setup went smoothly given clear\",\n        \" \",\n        react_1.default.createElement(\"a\", { href: \"http://nginx.org/en/docs/http/load_balancing.html\", target: \"_blank\", rel: \"noreferrer\" }, \"documentation\"),\n        \" \",\n        \"on what to do. After launching a second EC2 instance and a separate NGINX instance, I linked the three together in the configuration file like so:\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/config.jpg\", alt: \"2 servers config\" }),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"Now requests being sent to the NGINX server\\u2019s endpoint would be distributed between both servers, thus lessening the strain on each individual one. It\\u2019s important to note that only one database is being shared between the two servers.\"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"With two servers and a functioning load balancer, I booted up Loader.io again:\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/532ms.jpg\", alt: \"532ms at 1000rps\" }),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"Where 1000 RPS had previously drawn an error rate of 34.8% and a latency of almost 500 ms, we now had a 0% error rate at a latency of 74 ms. Woot!\"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"Let\\u2019s see how far we can take this\\u2026\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/424ms.jpg\", alt: \"424ms at 2400rps\" }),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"We made it all the way to 2400 RPS before reaching an error threshold of 50%. An incredible feat compared to a single running server. However, error rates started increasing at as little as 1500 RPS. For a practical user experience, we could not allow for errors like that. We had to do even better.\"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"I scaled up to five separate instances and recorded the results each step of the way.\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/aws.jpg\", alt: \"aws setup\" }),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"Along the way I noticed a few things. As shown above, the difference between one server and two was night and day. However returns certainly diminished by server four and five.\"),\n    react_1.default.createElement(\"h4\", { className: styles_module_scss_1.default.sectionHeader }, \"2500 RPS at server 4:\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/436ms.jpg\", alt: \"436ms at 2500rps\" }),\n    react_1.default.createElement(\"h4\", { className: styles_module_scss_1.default.sectionHeader }, \"2500 RPS at server 5:\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/362ms.jpg\", alt: \"362ms at 2500rps\" }),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"As depicted above, performance rates were actually worse with five servers. External factors or not, it was time to employ new strategies. The NGINX documentation mentioned two possible options for load balancing. The default was \\\"round-robin\\\", where requests would be sent to each server following the same order. There was also the option of \\\"least-conn\\\", where requests would be sent to the server most available to handle a new request. We tried that out:\"),\n    react_1.default.createElement(\"h4\", { className: styles_module_scss_1.default.sectionHeader }, \"2800 RPS round-robin:\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/roundrobin.jpg\", alt: \"379ms at 2800rps round-robin\" }),\n    react_1.default.createElement(\"h4\", { className: styles_module_scss_1.default.sectionHeader }, \"2800 RPS least-conn:\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/leastconn.jpg\", alt: \"391ms at 714rps least-conn\" }),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"As pictured, we achieved a dip in latency and error rate when after switching over to least-conn. Not bad!\"),\n    react_1.default.createElement(\"h3\", { className: styles_module_scss_1.default.sectionHeader }, \"Caching\"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text },\n        \"Another optimization tweak NGINX offered was\",\n        \" \",\n        react_1.default.createElement(\"a\", { href: \"https://www.nginx.com/blog/nginx-caching-guide/\", target: \"_blank\", rel: \"noreferrer\" }, \"data caching\"),\n        \". The idea of caching is that data gets stored in an accessible location, such that next time the data is called the server needs not reach all the way into the database to acquire it.\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/caching.jpg\", alt: \"5 servers config\" }),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"Notice the least_conn and caching directives. With this in play, we ran our Loader.io again.\"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text },\n        \"After\",\n        \" \",\n        react_1.default.createElement(\"a\", { href: \"https://www.dropbox.com/home/SDC%20Metrics\", target: \"_blank\", rel: \"noreferrer\" }, \"multiple tests\"),\n        \", I arrived at the highest RPS with 0% error rate.\"),\n    react_1.default.createElement(\"img\", { className: styles_module_scss_1.default.image, src: \"/420ms.jpg\", alt: \"420ms at 2100rps\" }),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"I was able to handle 2100 RPS with 67 ms latency. It took 4 load balancers, least_conn, and caching to achieve this result. Compared to 80 ms latency at 500 RPS, I would say the experimenting has led to a success.\"),\n    react_1.default.createElement(\"h3\", { className: styles_module_scss_1.default.sectionHeader }, \"Conclusion\"),\n    react_1.default.createElement(\"p\", { className: styles_module_scss_1.default.text }, \"At the end of the day, my team and I learned a lot about what it takes for a production level site to handle traffic. We were exposed to the limitations of certain strategies and realized that tradeoffs were required when it came to optimizing a server. As it holds true for most cases in programming, there\\u2019s no one-size-fits-all method for server improvement. Overall, the main take away would be to keep benchmarking and testing new strategies to further optimize results. I hope you enjoyed following me on this journey and gained some knowledge or even inspiration from it. Remember, stay focused and always stay learning!\"))); };\nexports[\"default\"] = SDC;\n\n\nconst $ReactRefreshModuleId$ = __webpack_require__.$Refresh$.moduleId;\nconst $ReactRefreshCurrentExports$ = __react_refresh_utils__.getModuleExports(\n\t$ReactRefreshModuleId$\n);\n\nfunction $ReactRefreshModuleRuntime$(exports) {\n\tif (false) {}\n}\n\nif (typeof Promise !== 'undefined' && $ReactRefreshCurrentExports$ instanceof Promise) {\n\t$ReactRefreshCurrentExports$.then($ReactRefreshModuleRuntime$);\n} else {\n\t$ReactRefreshModuleRuntime$($ReactRefreshCurrentExports$);\n}\n\n//# sourceURL=webpack://bertrand-porfolio/./src/pages/Blog/posts/SDC/index.tsx?");

