eval("module.exports = JSON.parse('[{\"name\":\"Squad Goals\",\"timePeriod\":\"May 2020 - July 2020\",\"description\":\"A mobile-first web app that holds you accountable to goals with the help of teammates and friends.\",\"anchorLink\":\"#squad-goals\",\"videoSrc\":\"squadgoalsdemo.mov\",\"isMobileApp\":true,\"technologies\":[\"React\",\"Redux\",\"Firebase\",\"Material-UI\"],\"playLink\":\"https://accountability-tracker-friends.web.app/\",\"gitHubLink\":\"https://github.com/bertrandcodes/Squad-Goals\",\"modalContent\":{\"description\":\"A mobile first accountability tracker app that leverages support from others to hit daily and long-term goals. Features include: fully secure login and signup authentication, friend-adding functionality, profile picture upload, daily multiplayer challenges, and streaks/past completion history.\",\"bulletPoints\":[\"Deployed a streak feature using scheduled cloud functions to hold users accountable and maintain consistent progress\",\"Leveraged Firebase to provide authorized real-time updates as part of a fresh and secure user experience\",\"Composed a highly structured and clean layout using Material-UI framework\"]}},{\"name\":\"Hire-Mee\",\"timePeriod\":\"March 2020 - August 2020\",\"description\":\"An app that helps manage information related to the jobs you\\'re applying for.\",\"anchorLink\":\"#hire-mee\",\"videoSrc\":\"hiremeedemo.mov\",\"isMobileApp\":false,\"technologies\":[\"React\",\"PostgreSQL\",\"Express\",\"Node.js\"],\"playLink\":\"http://54.183.118.152:3000/\",\"gitHubLink\":\"https://github.com/hire-mee\",\"modalContent\":{\"description\":\"Inspired by the overwhelming volume of job applications among our fellow job-seeking peers, my team and I designed Hire-Mee as a platform to organize and display all job sensitive information. Features include: an interactive list that allows user to seamlessly move jobs between different status piles, user statistic page along with individual job post modals that display information, fully-functional friends list, leaderboard feature, and interactive map that allows users to track job locations relative to themselves.\",\"bulletPoints\":[\"Leveraged PostgreSQL to build a one-to-many friends feature that supplies updated information between users\",\"Retrieved data points to create a real-time leaderboard that allows users to directly track progress against each other\",\"Implemented an interactive map using Google Maps API that displays job locations relative to each other as well as the user\"]}},{\"name\":\"Dancer\\'s Room\",\"timePeriod\":\"November 2020\",\"description\":\"A delayed webcam tool for for dancers to train and grow with.\",\"anchorLink\":\"#dancers-room\",\"videoSrc\":\"dancersroomdemo.mov\",\"isMobileApp\":false,\"technologies\":[\"React\",\"VanillaJS\",\"SCSS\"],\"playLink\":\"https://dancersroom.com/\",\"gitHubLink\":\"https://github.com/bertrandcodes/delayed-mirror\",\"modalContent\":{\"description\":\"Mirror aren\\'t always the most reliable. Recording yourself will have you squatting until your knees scream. Well knee pain no more! Introducing dancer’s room, the one-of-the-kind app that allows you to dance and watch yourself to your heart\\'s content. Dance, stop, and critique without ever having to press another pause/play button again. This also helps to check your form while playing sports. Golfer dads rejoice!\",\"bulletPoints\":[\"Webcam API with an adjustable delay feature\",\"Freestyle generator for endless dancing ideas\",\"More dance-related features to come!\"]}},{\"name\":\"Adidas Mock-Up\",\"timePeriod\":\"March 2020 - April 2020\",\"description\":\"A fully-functional clone of an Adidas product page done using Redux.\",\"anchorLink\":\"#FEC\",\"videoSrc\":\"productadidas.mov\",\"isMobileApp\":false,\"technologies\":[\"React\",\"Redux\",\"Express\",\"MongoDB\"],\"playLink\":null,\"gitHubLink\":\"https://github.com/HRLA35-CS-ADIDAS/Bertrand_Product_View\",\"modalContent\":{\"description\":null,\"bulletPoints\":[\"Utilized React along with ​reconciliation logic​ to emulate a fully functioning Adidas product page\",\"Deployed proxy server on ​AWS EC2​ instance while adhering to ​service oriented architecture​ principles\",\"Dockerized​ web app to ensure consistent runtime environment and cross-platform execution\",\"Refactored codebase using Redux\"]}},{\"name\":\"System Design\",\"timePeriod\":\"April 2020 - June 2020\",\"description\":\"Increased a database to hold 10,000,000 records and horizontally scaled servers for speed.\",\"anchorLink\":\"#SDC\",\"videoSrc\":\"sdc.mp4\",\"isMobileApp\":false,\"technologies\":[\"PostgreSQL\",\"AWS\",\"Node.js\",\"NGINX\"],\"playLink\":null,\"gitHubLink\":\"https://github.com/HRLA35-SDC/Bertrand-SDC-Component\",\"modalContent\":{\"description\":null,\"bulletPoints\":[\"Increased data set from 100 to 10,000,000 unique records efficiently by using ​draining​ and ​streaming​ techniques\",\"Horizontally scaled​ a legacy code base deployed over ​5 AWS T2 micro instances​ capable of handling ​2100 requests per second(average latency 67 ms, error rate 0.0%)\",\"Implemented Nginx as a ​round-robin/least-conn​​load balancer ​and​ cache​ to further reduce latency by 27%\"]}}]');\n\n//# sourceURL=webpack://bertrand-porfolio/./src/pages/Applications/applications.json?");

